import React from "react";
import { Link } from "react-router-dom"; // Link 임포트
import '../Css/Sidebar.css'; // 올바른 경로로 CSS 임포트

function Sidebar() {
  return (
    <div>
      <ul className='categoryTab'>
        {['About', 'Members'].map(cate => {
          return (
            <li key={cate}> {/* 'Li'를 'li'로 수정 */}
              <Link to={`/home/${cate.toLowerCase()}`}>{cate}</Link> {/* 경로 수정 */}
            </li>
          );
        })}
      </ul>
    </div>
  );
}

export default Sidebar;
